import React from "react";
export default function Contacts() {
  return (
    <div className="contacts">
      <img src="cardimg.png" alt="error" />
      <h3>Mr.whisk</h3>
      <div className="info-grp">
        <p>124567890</p>
      </div>
      <div className="info-grp">
        <p>mr.whisk@gmail.com</p>
      </div>
    </div>
  );
}
